// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Storage {

    mapping (address=>string) store;
    address[] addresses;

    function push(string memory _text) external {
        store[msg.sender] = _text;
    }

    function retrieve() external view returns(address[] memory, string[] memory)
    {

       address[] memory returnKeys = new address[](addresses.length);
       string[] memory returnValues  = new string[](addresses.length);

       for(uint i = 0; i < addresses.length; i++)
       {
           returnKeys[i] = addresses[i];
           returnValues[i] = store[addresses[i]];
           i++;
       }
       return(returnKeys, returnValues);
    }
}

